import React from "react";

function Items({ items }) {
  return (
    <div className="row">
      <div className="card">
        <img src={items.image} />
        <h4>{items.title}</h4>
        <p>{items.details}</p>
        <p>{items.price}</p>
        <a href="#" className="btn">
          ReadMore...
        </a>
      </div>
    </div>
  );
}

export default Items;
